import './App.css';
import React from 'react';
import {Routes, Route} from "react-router-dom";

import {
  Home,
  AddReviews
} from "./pages";

function App() {

  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />}/>
        <Route path="/AddReviews" element={<AddReviews />}/>
      </Routes>
    </div>
  );
}

export default App;
